import Header from './Header';
const SubmitPage = () => {
    const navigate = useNavigate();
    return (
       <>
       <Header/>
       <div className='submit-content'>
        <div className='left'>
                    <span>Transaction Reference Number (TRN): EGOY85FCFC</span>
        </div>
        
       </div>
       </>
    )
}

export default SubmitPage;
